queries.callback:
_.chain(context)
.uniq(function(x) {
return x.BAIRRONR
})
.map(function(place){
return {
data_value:place.BAIRRONR,
display:{title: {text: place.BAIRRO} } };
}).value()

_.map(context, function(place){place.data_value = place.TABZ;
place.display = {title: {text: place.ZONE} };
return place;
})

